`,title:"BiSeNet: Bilateral Segmentation Network for  Real-time Semantic Segmentation",icon:"note-sticky",type:"article"}}],["/master/research/semseg/icnet2018.html",{loader:()=>I(()=>import("./icnet2018.html-CJjcwEDM.js"),__vite__mapDeps([45,1])),meta:{date:174304306e4,tag:["Semantic Segmentation"],excerpt:`<ul>
